    <p>Ко́шка — домашнее животное, одно из наиболее популярных «животных-компаньонов». 
      С точки зрения научной систематики, домашняя кошка — млекопитающее семейства 
      кошачьих отряда хищных. Одни исследователи рассматривают домашнюю кошку как 
      подвид дикой кошки, другие — как отдельный биологический вид.</p>
